    public function getMap($dbSuffix = 'staging'){

        $sogService = new SogService(false,$dbSuffix);
        $sogGameData = new SogGameDataService($dbSuffix);
       return $sogGameData->getMap();

    }

    public function setMap($dbSuffix = 'staging'){

        $sogService = new SogService(false,$dbSuffix);
        $sogGameData = new SogGameDataService($dbSuffix);
        $json = file_get_contents('php://input');
        $sogGameData->setMap($json);
        return $json ;

    }

    public function getLevel($levelId,$bundle,$dbSuffix = 'staging'){

        $sogService = new SogService(false,$dbSuffix);
        $sogGameData = new SogGameDataService($dbSuffix);
        return $sogGameData->getLevel('prod');

    }

